import React, { useState } from 'react';
import { withRouter } from 'react-router-dom';

const Details = (props) => {
    const [id, updateId] = useState(props.location.search.slice(1, -1));

    return (
        <div>{id}</div>
    );
}

export default withRouter(Details);
